(79, 1, '1627468585.png', 'DAL Organizer', 'DAL Organizer merupakan sebuah platform untuk memudahkan orang dalam persiapan pernikahan. Dengan duduk manis anda bisa mendapatkan wedding sesuai dengan keinginan dan impian semua orang. Kamu juga bisa berdiskusi dengan pasangan dengan mudah dan dimana saja. Enjoy and find your happiness with DAL Organizer\r\n\r\nFeatures Of DAL Wedding Planner \r\n        ⁃        Berbasis website \r\n        ⁃        Venue Reality\r\n        ⁃        Memiliki banyak pelayanan (Musik, Catering, Dance)\r\n        ⁃        Contact Vendor', 'https://www.youtube.com/watch?v=FD3dolqvJVk', 'https://meet.google.com/snc-yisb-xbb', 2021, '2021-07-22 11:30:35', '2021-07-29 02:39:57'),
(100, 1, '1627478258.png', 'Ambulance Yayasan Musi Raya', 'Ambulance Yayasan Musi Raya adalah Yayasan yang bergerak di bidang ambulance, \r\n Kami Yayasan Musi Raya yang bergerak di bidang pelayanan, Ambulance dan Mobil Jenazah.\r\n Siap membantu dan melayani bagi keluarga yang berduka.Kami siap melayani area : Jakarta,Bogor,Depok,Tangerang,Bekasi dan sekitar nya, dan kami juga dapat melayani\r\n customer kami yang berada di luar kota.Kami meyediakan ambulance untuk kepentingan emergency pasien, antar jenazah, pelayanan event dan acara, juga on site pelayanan untuk proyek yang memiliki resiko tinggi', 'https://www.youtube.com/watch?v=AHa5mJFlqOg&ab_channel=JTIKPNJ', 'https://meet.google.com/xxx-yyyy-zzz', 2021, '2021-07-23 06:47:34', '2021-07-28 13:17:38'),
(102, 1, '1627469604.png', 'Rumah Sakit Sentra Medika Mobile', 'Aplikasi Rumah Sakit Sentra Medika Mobile adalah aplikasi dengan memaanfaatkan platform android untuk memberikan informasi akurat tentang berbagai macam informasi rumah sakit seperti jadwal dokter, fasilitas, layanan dan lain nya. Aplikasi ini juga mendapatkan mendapatkan nomor antrian dengan lebih mudah, dengan adanya aplikasi ini diharapkan mampu mengurangi permasalahan antrian yang meyebabkan menumpuknya calon pasien', 'https://youtu.be/NtJL8TQiQ6M', 'https://meet.google.com/bee-syti-ria', 2021, '2021-07-28 10:53:24', '2021-07-28 11:07:30'),
(103, 1, '1627478677.png', 'Make Up Artist', 'Sistem aplikasi ini merupakan platform untuk membuat ulasan (review) dari produk kecantikan dalam hal ini make up dan melakukan reservasi jasa make up untuk berbagai kebutuhan seperti wisuda, pernikahan, pesta maupun acara lainnya. Dalam kondisi pandemi, sektor usaha yang berkecimpung di dunia kecantikan terdampak secara langsung, namun pada acara yang sudah direncanakan sedemikian rupa seperti pernikahan maupun wisuda, tentu saja tidak dengan mudah ditunda atau bahkan dihilangkan. Yang bisa dilakukan adalah untuk menyesuaikan dengan kondisi sekarang. Dengan aplikasi ini, dimana pengguna bisa melakukan reservasi jasa make up artist yang tersedia dengan lebih mudah. Kelak ketika pandemi sudah berakhir, aplikasi ini juga dapat digunakan mengingat efisiensi platform yang mempertemukan kebutuhan pengguna dengan penyedia jasa/barang.', 'https://youtu.be/VB4ka0tDLS0', 'https://meet.google.com/gaj-jeyk-hko', 2021, '2021-07-28 13:24:38', '2021-07-28 13:24:38'),
(104, 1, '1627479450.png', 'SANDANGQ', 'Limbah tekstil masuk dalam rangking keempat terbesar penyumbang carbon emission (emisi karbon) di landfill. Website SandangQ dibuat agar masyarakan mendonasikan pakaian yang sudah tidak terpakai tetapi masih layak guna membantu sesama dan mengurangi sampah tekstil di dunia.', 'https://youtu.be/NQZ-xLfLGkI', 'https://meet.google.com/ogn-xmbx-mfs', 2021, '2021-07-28 13:37:30', '2021-07-29 03:17:34'),
(105, 1, '1627479514.png', 'KOPI SEGMEN - Modul Absen', 'Aplikasi ini berfungsi sebagai perekam data kehadiran karyawan dengan cara membuka web absensi setiap harinya untuk melakukan verifikasi.', 'https://youtu.be/W_Jvv8SpbwU', 'https://meet.google.com/vyf-gvwz-ebd', 2021, '2021-07-28 13:38:34', '2021-07-28 13:38:34'),
(106, 1, '1627479559.png', 'KOPI SEGMEN - Modul Kasir', 'Aplikasi ini berfungsi sebagai kasir untuk kedai KOPI SEGMEN dengan fitur pencatatan setiap transaksi penjualan yang mencatat pelayan pelanggan , produk yang dibeli oleh pelanggan , dan pelanggan yang membeli baik harian , bulanan , tahunan.', 'https://youtu.be/Q2CKpt25AZU', 'https://meet.google.com/vyf-gvwz-ebd', 2021, '2021-07-28 13:39:19', '2021-07-28 13:39:19'),
(107, 1, '1627479616.png', 'KOPI SEGMEN - Modul Stok', 'Aplikasi ini berfungsi sebagai pendataan stok barang yang terdapat di kedai KOPI SEGMEN dan memiliki fitur notifikasi jika terdapat barang yang sudah hampir habis.', 'https://youtu.be/o6ANGxmbbwQ', 'https://meet.google.com/vyf-gvwz-ebd', 2021, '2021-07-28 13:40:16', '2021-07-28 13:40:16'),
(108, 1, '1627479672.png', 'Darebee Workout', 'Aplikasi Panduan Olahraga Berbasis Android adalah sebuah aplikasi yang digunakan sebagai panduan olaraga untuk para pemula yang ingin melalukan olahraga, di dalam aplikasi terdapat beberapa fitur seperti panduan olahraga, berita yang berkaitan dengan olahraga, toko online yang menjual peralatan olahraga, dan rekomendasi makanan – makanan sehat.\r\nDalam panduan olahraga terdapat beberapa macam olahraga seperti yoga, boxing, running, dan strenuous. Selain itu di dalamnya juga berisi gambar illustrasi dan stopwatch untuk menghitung waktu olahraga sesuai dalam panduan yang ditentukan.', 'https://youtu.be/jVhkGqU-cC4', 'https://meet.google.com/phv-cagi-wus', 2021, '2021-07-28 13:41:12', '2021-07-28 13:41:12'),
(109, 1, '1627479716.png', 'Jobpy Hyris Solution', 'Aplikasi JobPy merupakan sebuah aplikasi yang berjalan di Human Resource/SDM yang dikhususkan untuk Perusahaan yang ingin mencari solusi Terhadap Informasi Karyawan baik kinerja maupun gaji sehingga membantu para HR untuk Memanage Sumber Daya Menggunakan Aplikasi ini.\r\nSehingga aplikasi ini dibuat dengan fitur-fitur sesuai dengan masalah yang ada. Aplikasi ini berjenis hybrid application dimana dapat diakses baik oleh Karyawan maupun Atasan melalui android dan Web. Sistem ini akan terintegrasi dengan 1 aplikasi web, dan 1 aplikasi mobile', 'https://youtu.be/KKSO4zbquJg', 'https://meet.google.com/sos-kxmz-jze', 2021, '2021-07-28 13:41:56', '2021-07-28 13:41:56'),
(110, 1, '1627479765.png', 'Donorin', 'Aplikasi Donorin merupakan sebuah aplikasi yang berjalan di bidang Kesehatan yang dikhususkan untuk Palang Merah Indonesia Kabupaten Bogor untuk mempermudah  calon pendonor dalam melakukan pendaftaran donor darah.', 'https://youtu.be/qF4w7pCKABk', 'https://meet.google.com/mpt-vrbf-bcv', 2021, '2021-07-28 13:42:45', '2021-07-28 13:42:45'),
(111, 1, '1627479818.png', 'Sporties App', 'Sporties App adalah aplikasi pencarian sarana olahraga di kota Depok. Fitur yang ada di Sporties App adalah Maps dan List Sarana Olahraga. Pengguna dapat melihat apa saja sarana olahraga yang ada di kota Depok berdasarkan kategori jenis olahraga. dan juga dapat melihat lokasi serta rute dari lokasi user ke tempat tersebut. Sporties App juga menyajikan musik di dalam nya yang juga dapat di nyalakan atau di matikan.', 'https://youtu.be/SYrtqhWa2Uk', 'https://meet.google.com/qig-kmbt-dxr', 2021, '2021-07-28 13:43:39', '2021-07-28 13:43:39'),
(112, 4, '1627479963.jpg', 'Smart Classroom', 'Sistem Smart Classroom merupakan sebuah sistem tertanam dan aplikasi berbasis web yang dibuat untuk mempermudah penggunaan kelas. Dengan sistem dan aplikasi yang akan dibuat, pengguna dapat memantau dan mengontrol data absensi peserta didik serta mengontrol peralatan yang ada didalam kelas yang terintegrasi pada Sistem Smart Classroom. Aplikasi dapat digunakan untuk melihat data seperti absensi, ruang kelas, dam jadwal, serta memungkinkan pengguna untuk menyalakan dan mematikan peralatan yang ada didalam kelas.', 'https://youtu.be/c2ETK06PE18', 'https://meet.google.com/vwz-iyns-gad', 2021, '2021-07-28 13:46:04', '2021-07-28 13:46:04'),
(113, 1, '1627480245.png', 'Evenesia', 'Aplikasi Evenesia merupakan aplikasi penyedia informasi seputar event. Diantaranya informasi detail berbagai macam vendor, mulai dari kontak hubung, kapasitas, list harga, rating pengguna, dan portofolio dari tiap vendor. Aplikasi ini juga menyediakan fitur Event Plan yang dapat digunakan untuk membuat jadwal yang akan disusun dalam mempersiapkan event dan fitur Hi Event yang dapat digunakan untuk melihat event yang sedang berlangsung dan dapat memesan tiket. Serta menyediakan artikel seputar dunia event, mulai dari informasi trend terkini, event yang akan berlangsung, hingga tips dalam persiapan event.', 'https://youtu.be/acdziWTVEQ0', 'https://meet.google.com/cjo-ffac-bjn', 2021, '2021-07-28 13:50:45', '2021-07-28 13:50:45'),
(114, 1, '1627480356.jpeg', 'SAWIT ID', 'Sawit ID merupakan suatu platform yang memudahkan masyarakat petani kelapa sawit dalam menjual hasil tani dari lahan kelapa sawit milik mereka. Dengan potongan harga rendah, biaya angkut terjangkau, menunggu supir terdekat menjemput (waktu penimbangan buah kelapa sawit lebih cepat), dapat melakukan booking penjemputan buah melalui Whatsapp. Dengan hadir-nya Sawit ID menjawab semua keluhan masyarakat petani.', 'https://youtu.be/N52tVAFTD1I', 'https://meet.google.com/aov-pwcn-fpx', 2021, '2021-07-28 13:52:36', '2021-07-28 13:52:36'),
(115, 4, '1627483641.jpg', 'Implementasi OpenCV Menggunakan ROS untuk Robot Sepak Bola Beroda', 'Robot menggunakan kamera digital (webcam) sebagai input utama untuk  mendeteksi keberadaan bola dan juga gawang lawan, dalam pemrosesan gambar menggunakan platfrom Robot Operating System (ROS).  Hasil dari deteksi bola akan dijadikan input untuk menggerakan motor DC sehingga robot dapat mengejar bola, kompas digital sebagai penentu arah gawang lawan.', 'https://youtu.be/LFx3JeK4Sxo', 'https://meet.google.com/ukt-mqsp-fuv', 2021, '2021-07-28 14:47:21', '2021-07-28 14:47:21'),
(116, 1, '1627483698.png', 'Fokoline', 'Fokoline merupakan sebuah platform yang menyediakan kemudahan dalam melakukan cetak dokumen yang dapat dilakukan oleh pengguna dimana saja. Dengan adanya website ini membuat kita dapat melakukan cetak dokumen tanpa harus mengantre dan juga kita juga mentaati protokol kesehatan yang berlaku', 'https://youtu.be/g5HbaVnA0iM', 'https://meet.google.com/bdy-oxnf-nwd', 2021, '2021-07-28 14:48:19', '2021-07-28 14:48:19'),
(117, 1, '1627483783.jpg', 'Foodpedia', 'Foodpedia adalah sebuah aplikasi berbasis android yang dapat digunakan untuk para pengguna yang menginginkan sebuah aplikasi yang easy to use dan friendly. dikarenakan dalam satu aplikasi ini terdapat banyak data resep yang diaplikasikan dan ini mempermudah pengguna yang memiliki hobi memasak untuk menggunakannya. Diaplikasi kami pengguna dapat mencari menu, mewhistlist menu dan juga melakukan berbagai pencarian berdasarkan kategori yang sudah kamu kelompokkan di dalam aplikasi', 'https://youtu.be/TFIHoTBwWBI', 'https://meet.google.com/nun-eeij-wag', 2021, '2021-07-28 14:49:43', '2021-07-28 14:49:43'),
(118, 1, '1627483840.png', 'Tini Mart Siswar', 'Sistem Transaksi Warung adalah sistem warung berbasis website untuk mencatat transaksi jual-beli, mengelola data, membuat laporan, memudahkan proses transaksi jual-beli, dan menyimpan data transaksi dan laporan.', 'https://youtu.be/bjjH9rsYcUg', 'https://meet.google.com/gkp-rgjz-ggs', 2021, '2021-07-28 14:50:40', '2021-07-28 14:50:40'),
(119, 1, '1627528556.jpeg', 'Walktrips', 'Walktrips sebagai salah satu piooner platfrom website booking trip melihat adanya peluang open trip walking tour untuk wisatawan baik lokal ataupun mancanegara yang ingin mengeksplor daerah wisata yang tidak jauh dari lokasi tempat tinggal, terutama di wilayah Jabodetabek .\r\nAdanya open trip walking tour juga sebagai solusi untuk tour guide dalam menambah pendapatannya, karena selama masa pandemi, banyak tour guide Indonesia hampir kehilangan pekerjaan dikarenakan banyak agensi wisata yang tutup akibat wabah pandemi virus covid-19.', 'https://youtu.be/mpTjOP58A3A', 'https://meet.google.com/irs-xokk-yjg', 2021, '2021-07-28 14:52:09', '2021-07-29 03:15:56'),
(120, 3, '1627484032.jpg', 'Masakuy!', 'Aplikasi ini berfungsi untuk memberikan pilihan kepada pengguna untuk memilih makanan yang akan dibuat dari bahan makanan yang telah diidentifikasi. Fitur utama dalam aplikasi adalah mengidentifikasi bahan makanan dan merekomendasikan menu atau resep makanan.', 'https://youtu.be/SKufZwf0Urk', 'https://meet.google.com/rkg-uvrs-zmv', 2021, '2021-07-28 14:53:52', '2021-07-29 06:59:53'),
(121, 3, '1627484136.png', 'MoM', 'MoM adalah platform belajar online yang mempertemukan murid dengan mentor sesuai dengan pelajaran yang disukai dan juga dapat membantu untuk mendapatkan penghasilan tambahan dengan menjadi mentor sesuai dengan keahlian yang dimiliki.', 'https://youtu.be/cLAcigYPlCQ', 'https://meet.google.com/iry-rbia-cyt', 2021, '2021-07-28 14:55:36', '2021-07-28 14:55:36'),
(122, 3, '1627484203.png', 'VeriLive', 'VeriLive adalah Aplikasi mobile untuk verifikasi real-time dan langsung yang dilakukan secara online berbasis android.', 'https://youtu.be/tmo_DsNkw58', 'https://meet.google.com/zkt-gvkm-vxa', 2021, '2021-07-28 14:56:44', '2021-07-28 14:56:44'),
(123, 7, '1627484340.jpg', 'Nelayanku', 'Aplikasi  nelayanku merupakan  sebuah  solusi  agar  jumlah  dan  jenis  ikan  bisa  terdata  dengan  efektif dan  efisien  sehingga  informasi  yang  terdapat  di  aplikasi  nelayanku  dapat meningkatkan  angka  konsumsi  dan  produksi  ikan  per  kapita  di  Indonesia. Kesimpulan yang diperoleh adalah aplikasi nelayanku dapat menjadi solusi untuk meningkatkan angka konsumsi dan produksi ikan per kapita di Indonesia.', 'https://youtu.be/LBmE0LR4Yao', 'https://meet.google.com/pao-gten-bkb', 2021, '2021-07-28 14:59:00', '2021-07-28 14:59:00'),
(124, 5, '1627484430.jpg', 'The Ultimate Adventure of Life', 'GOALS: THE ULTIMATE ADVENTURE OF LIFE adalah sebuah game berbasis 2 dimensi side-scrolling.\r\nGame ini dapat dimainkan menggunakan mobile device (Smartphone).\r\nGame ini dibuat sebagai gambaran perjuangan seseorang dalam meraih cita-citanya.\r\nGame ini memiliki 3 level yang tiap levelnya memiliki musuh dan tantangan yang berbeda - beda, yang dimana akan dimulai dari level 1 (SD), lalu level 2 (SMP), dan yang terakhir level 3 (SMA).\r\nDi setiap level nya, pemain diharuskan menjawab sebuah pertanyaan (Kuis) untuk melanjutkan ke level berikutnya. Hal tersebut dibuat untuk menciptakan \"feel\" yang lebih nyata tentang perjuangan dalam meraih cita-cita.', 'https://youtu.be/B0L0IyQkHKE', 'https://meet.google.com/pmi-uknx-aej', 2021, '2021-07-28 15:00:30', '2021-07-28 15:00:30'),
(125, 2, '1627484552.jpg', 'Evolusi Manusia Purba Indonesia', 'Produk animasi 2D ini dibuat menggunakan Sofware Adobe Photoshop, Illustrator, After Effect, Premiere. Terdapat karakter utama yaitu Ibu Puff yang menjelaskan mengenai apa itu Teori Evolusi, asal-usul Teori Evolusi Darwin serta jenis-jenis manusia purba yang ada di indonesia. Mulai dari Meganthropus, Pithecantropus sampai manusia jenis Homo yaitu Homo Wajakensis, Floresiensis dan Soloensis. Pembelajaran didukung oleh gambar yang dianimasikan, teks serta audio yang memperjelas penyampaian materi.', 'https://youtu.be/4ZiZaSWQpOM', 'https://meet.google.com/bdy-nszq-kxq', 2021, '2021-07-28 15:02:33', '2021-07-28 15:02:33'),
(126, 6, '1627484779.jpg', 'Jaga Laut Kita', '\'Jaga Laut Kita\' merupakan sebuah karya video mapping yang menceritakan tentang kehidupan laut sebelum dan sesudah tercemar. Bagaimana dampak yang akan terjadi jika laut terus menerus tercemar.\r\n\r\nSelain sebagai hiburan, diharapkan dengan adanya video mapping ini dapat menyadarkan masyarakat terutama anak-anak bahwa pentingnya menjaga kebersihan lingkungan.\r\n\r\nJadi, mau sampai kapan laut akan tercemar?', 'https://youtu.be/n4G9zC4_luY', 'https://meet.google.com/vng-fczb-cqw', 2021, '2021-07-28 15:06:19', '2021-07-28 15:06:19'),
(127, 2, '1627484877.jpg', '5 Tempat Bersejarah yang Berpengaruh Terhadap Kemerdekaan Indonesia di Jakarta dalam Bentuk 3 Dimensi', 'Animasi 3 Dimensi ini menceritakan tentang tempat-tempat bersejarah dalam kemerdekaan Indonesia di daerah DKI Jakarta yang dipandu oleh Bimo. Terdapat 5 tempat bersejarah yang dibahas dalam animasi ini, yaitu Museum Perumusan Naskah Proklamasi, Monumen Nasional, Gedung Radio Republik Indonesia, Museum Sumpah Pemuda, dan juga Museum Fatahillah.', 'https://www.youtube.com/watch?v=PEGSF093IRo', 'https://meet.google.com/uug-ziuh-vtn?authuser=2', 2021, '2021-07-28 15:07:57', '2021-07-29 02:42:23'),
(128, 6, '1627484951.png', 'ANGMUJA (Virtual Reality Museum Angkutan Umum)', 'Museum virtual ini bertujuan menaikan kembali tingkat ketertarikan masyarakat dalam masa pandemi, masyarakat tidak perlu khawatir tentang kerumunan yang terjadi karena kali ini masyarakat dapat merasakan seperti berada di museum yang bisa mereka akses dimanapun.', 'https://youtu.be/5rRfG_PGieo', 'https://meet.google.com/hxm-chbb-jvh', 2021, '2021-07-28 15:09:12', '2021-07-28 15:09:12'),
(129, 5, '1627485163.png', 'Aplikasi Augmented Reality & Game Berbasis Web untuk Edukasi Sampah', 'sARmpah adalah aplikasi web Augmented Reality (AR) untuk edukasi mengenai sampah yang memiliki tujuan untuk mengedukasi masyarakat khususnya yang berada di wilayah Politeknik Negeri Jakarta (PNJ) mengenai permasalahan sampah terutama pemilahan dan pengelolaannya dengan cara yang menyenangkan dan terjangkau.', 'https://youtu.be/XF6qbzs1yug', 'https://meet.google.com/dch-mszq-brz', 2021, '2021-07-28 15:12:43', '2021-07-28 15:12:43'),
(130, 6, '1627485235.png', 'Video Mapping Investasi Di Masa Pandemi', '“Investment in Pandemic” merupakan video mapping yang mengangkat tema investasi. Jika video mapping biasanya digunakan dalam seni pertunjukan, pada kali ini kami menginovasi video mapping menjadi sebuah media edukasi yang menarik.', 'https://youtu.be/JlLn1bAakwQ', 'https://meet.google.com/yqy-iykg-oru', 2021, '2021-07-28 15:13:55', '2021-07-28 15:13:55'),
(131, 5, '1627485294.png', 'BURN OUT (Game Visual Novel 2D)', 'Game ini merupakan sebuah game visual novel 2D yang mengangkat tema psikologi. Game ini menceritakan tentang seorang pekerja kantoran yang mengalami burnout / depresi. Game ini bercerita mengenai apa yang dihadapi pekerja tersebut sehingga akhirnya menyebabkan dirinya mengalami burnout dan upaya yang\r\ndilakukannya untuk keluar dari kondisi tersebut. Dalam game ini terdapat pilihan-pilihan yang nantinya akan menentukan akhir cerita yang didapatkan oleh pemain. Tujuan dari game ini adalah untuk mengedukasi tentang burnout, seperti seberapa berbahayanya\r\nburnout, apa saja penyebabnya, dan bagaimana cara agar dapat terhindar dari burnout.', 'https://youtu.be/4Ch5pIZrTUg', 'https://meet.google.com/vzs-bnpj-bdq', 2021, '2021-07-28 15:14:55', '2021-07-28 15:14:55'),
(132, 1, '1627485329.jpeg', 'Ngopiin', 'UMKM warung kopi perlu adanya pemberdayaan dan promosi warung kopi untuk meningkatkan daya beli masyarakat dan tempat berkumpul. Dengan cara memberikan platform berbasis alpikasi masyarakat sudah bisa mencari warung kopi terdekat ataupun terpenci di suatu daerah dan masyarakat bisa melihat menu kopi tanpa harus bingung mencari link dari platform lain.', 'https://youtu.be/NvnS0EQYD1Q', 'https://meet.google.com/xud-xrje-siv', 2021, '2021-07-28 15:15:30', '2021-07-28 15:15:30');
